let places = new Map()
function indexPlaces(a) {
  if (a && a.length) {
    for (let i of a) {
      places.set(i.Id, i)
      indexPlaces(i.Children)
    }
  }
}
indexPlaces(provinces)

export function findPlaceById(id) {
  return places.get(id)
}

export class Admap {
	constructor(address) {
		this.address = address
		this.tree = new Map()
		this.initDataTree()
	}
	initDataTree() {
		this.address.forEach(item => {
			this.tree.set(item.Id, [[item.Name, item.Id]])
			if (item.Children) {
				item.Children.forEach(j => {
					this.tree.set(j.Id, [[item.Name, item.Id], [j.Name, j.Id]])
					if (j.Children) {
						j.Children.forEach(k => {
							this.tree.set(k.Id, [[item.Name, item.Id], [j.Name, j.Id], [k.Name, k.Id]])
						})
					}
				})
			}
		})
	}
	getAddress(id) {
		return this.tree.get(id)
	}
}